-- -----------------------------------------------------
-- Schema bd_portugal
-- -----------------------------------------------------
DROP SCHEMA IF EXISTS `bd_portugal` ;

-- -----------------------------------------------------
-- Schema bd_portugal
-- -----------------------------------------------------
CREATE SCHEMA IF NOT EXISTS `bd_portugal` DEFAULT CHARACTER SET utf8 ;
USE `bd_portugal` ;

-- -----------------------------------------------------
-- Table `bd_portugal`.`distrito`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `bd_portugal`.`distrito` ;

CREATE TABLE IF NOT EXISTS `bd_portugal`.`distrito` (
  `id_distrito` INT NOT NULL,
  `nome` VARCHAR(65) NOT NULL,
  PRIMARY KEY (`id_distrito`))
ENGINE = InnoDB;

-- -----------------------------------------------------
-- Table `bd_portugal`.`concelho`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `bd_portugal`.`concelho` ;

CREATE TABLE IF NOT EXISTS `bd_portugal`.`concelho` (
  `id_concelho` INT NOT NULL,
  `nome` VARCHAR(45) NOT NULL,
  `id_distrito` INT NOT NULL,
  PRIMARY KEY (`id_concelho`),
  FOREIGN KEY (`id_distrito`) REFERENCES `bd_portugal`.`distrito` (`id_distrito`))
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `bd_portugal`.`freguesia`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `bd_portugal`.`freguesia` ;

CREATE TABLE IF NOT EXISTS `bd_portugal`.`freguesia` (
  `id_freguesia` INT NOT NULL,
  `nome` VARCHAR(100) NOT NULL,
  `url` VARCHAR(255) NULL,
  `id_concelho` INT NOT NULL,
  PRIMARY KEY (`id_freguesia`),
  FOREIGN KEY (`id_concelho`) REFERENCES `bd_portugal`.`concelho` (`id_concelho`))
ENGINE = InnoDB;

